$(document).ready( () => {
	$('[data-toggle="tooltip"]').tooltip();
	pintaHistorial();
});
let empleado = {
	nombre:"",
	aPat:"",
	aMat:"",
    curp: "",
    tel:"",
    ext: 300,
    correo: "",
    depto: 0
}
const pintaHistorial = () => {
	$.ajax({
		url: "/documento/historial/",
		dataType: "json",
		type: "get",
		success: (response) => {
			$.each(response, function( index, value ) {
				let fecha = "", estado = "", clase = "", opciones = ""
				value.creacion == null ? fecha = value.creacion : fecha = value.creacion.split("T")[0];
				switch(value.estado){
					case 0:
						estado = "Pendiente";
						clase = "text-warning";
					break;
					case 1:
						estado = "Aceptado";
						clase = "text-success";
					break;
					case 2:
						estado = "Rechazado"
						clase = "text-danger"
					break;
				}
				if(value.estado == 0)
					opciones = '<a class="text-danger" data-toggle="tooltip" data-placement="bottom" title="Visualizar PDF" onclick="solicitud('+value.id+')"><i class="far fa-file-pdf fa-2x"></i></a> &nbsp'+
							   '<a class="text-success" data-toggle="tooltip" data-placement="bottom" title="Aceptar reporte" onclick="revision('+value.id+',1)"><i class="far fa-check-circle fa-2x"></i></a> &nbsp'+
							   '<a class="text-danger" data-toggle="tooltip" data-placement="bottom" title="Cancelar reporte" onclick="revision('+value.id+',2)"><i class="far fa-times-circle fa-2x"></i></a>'
				else
					opciones ='<a class="text-danger" data-toggle="tooltip" data-placement="bottom" title="Visualizar PDF" onclick="solicitud('+value.id+')"><i class="far fa-file-pdf fa-2x"></i></a>'
			  	$("#body-historial").append(
					'<tr class="text-center" style="vertical-align: middle;">'+
						'<td style="vertical-align: middle;">'+value.id+'</td>'+
						'<td style="vertical-align: middle;"><b>'+value.nombreCompleto+'</b></td>'+
						'<td style="vertical-align: middle;">'+value.departamento+'</td>'+
						'<td style="vertical-align: middle;">'+fecha+'</td>'+
						'<td style="vertical-align: middle;">'+value.fechaInicio.split("T")[0]+" Al "+value.fechaFin.split("T")[0] +'</td>'+
						'<td style="vertical-align: middle;" class="'+clase+'"><b>'+estado+'</b></td>'+
						'<td style="vertical-align: middle;">'+
							opciones+
						'</td>'+
					'</tr>');
			});
		},
		error:(response) => {
			alert(response)
		}
	})
}
const solicitud = (id) => {
	//traemos el objeto con todos los datos del reporte
	$.ajax({
		url: "/documentos/"+id,
		dataType: "json",
		type: "get",
		success: (response) => {
			var reporte = response.documento,
				idEmp = response.documento.empleado
			getEmpleado(idEmp,reporte);
		},
		error:(response) => {
			alert(response)
		}
	});
}
const getEmpleado = (id,reporte) => {
	$.ajax({
		url: "/empleado/"+id,
		dataType:"json",
		type:"get",
		success:(response) => {
			let empleado = {
				nombre:response.nombre,
				aPat:response.aPat,
				aMat:response.aMat,
				clave:response.clave,
			    curp:response.curp,
			    tel:response.tel ,
			    correo: response.correo ,
			    depto: response.depto
			}
			console.log(reporte);
			console.log(empleado);
			pdf(reporte,empleado)			
		},
		error:(response) => {
			alert("A ocurrido un error al actualizar el registro")
		}
	})
}
const pdf = (reporte,empleado) => {
	var f = new Date();
	var poli = 'data:image/png;base64,';
	var logo = 'data:image/png;base64,';
	var doc = new jsPDF({
        format: 'a4',
        unit: 'mm',
        orientation: 'l'
    });
    //Cabecera
	doc.addImage(poli, 'JPEG', 49, 10, 50, 30)
	doc.setFontSize(15)
	doc.text('Instituto Politcnico Nacional',114,18);
	doc.text('Secretara de Innovacin e Integracin Social',95,24);
	doc.setFontSize(12)
	doc.text('Centro de Nanociencias y Micro y Nanotecnologas',100,30);
	doc.addImage(logo, 'JPEG', 206, 10, 25, 25)
	doc.setFontSize(15)
	doc.text('Designacin y seguimiento  de actividades laborales para el personal del CNMN.',18,48);
	doc.setFontSize(11)
	doc.text("Fecha de generacin: "+reporte.fecha.fechaCreacion,214,45)
	doc.text("Periodo de reporte:"+reporte.fecha.fechaI+"A"+reporte.fecha.fechaF,214,51)
	doc.setFontSize(14)
	doc.text('Datos del empleado',130,58);
	//Generamos datos del empleado
	doc.setFontSize(10)
	doc.printingHeaderRow = true;
	var columns = ["Apellido Paterno", "Apellido Materno", "Nombre(s)", "No.empleado","CURP","Telfono","Correo","rea"];
	var data = [[empleado.aPat, empleado.aMat,empleado.nombre,empleado.clave,empleado.curp,empleado.tel,empleado.correo,empleado.depto]];    
	doc.autoTable(columns,data,
	{ 
		theme : 'grid',
		headStyles: { halign: 'center',fillColor: [104, 36, 68] },
		margin:{ top: 63 },
		align:'center'
	});
	//Genramos actividades
	doc.setFontSize(14)
	doc.text('Registro de Actividades',125,92);
	var columns2 = ["#", "Ttulo", "Objetivo", "Descripcin","Entregable","Inicio","Fin","Impacto","Comunicacin","Entrega","Observaciones"];
	var data2 = [];
	for(var item in reporte.actividades){
		var elemento = reporte.actividades[item]
 		var arr = [item];
  		arr = arr.concat(Object.values(elemento));
		data2.push(arr)
	}
	//console.log(JSON.stringify(data2));   
	doc.autoTable(columns2,data2,
	{ 
		theme : 'grid',
		headStyles: { halign: 'center',fillColor: [104, 36, 68] },
		margin:{ top: 10 },
		startY: doc.autoTableEndPosY() + 12
	});
	//Firmas
	var columns = ["Nombre y firma del jefe inmediato", "Nombre y firma del director"];
	var data = [["", "" ],["Nombre del jefe inmediato","Dr.Miguel ngel Alemn Arce"]];    
	doc.autoTable(columns,data,
	{ 
		theme : 'grid',
		margin:{ top: 63 },
		columnStyles: { 
			0: { halign: 'center' },
			1: { halign: 'center' }
		},
		headStyles: { halign: 'center',fillColor:[104, 36, 68] },
		startY: doc.autoTableEndPosY() + 16,
		align:'center'
	});
	doc.save("reporte.pdf");
}
const revision = (id,tipo) => {
	$.ajax({
		url: "/documentos/"+id,
		dataType:"json",
		type:"put",
		data:{tipo},
		success:(response) => {
			alert("Registro actualizado con xito")
			location.reload();
		},
		error:(response) => {
			alert("A ocurrido un error al actualizar el registro")
		}
	})
}